import React from 'react';
import './App.css';
import '../Styles/layout.css';

// components
import Main from '../Components/Main';
import Footer from '../Components/Footer';

function App () {
  return (
    <>
      <header>
        <h1>Tweet Bot Wall</h1>
      </header>
      <Main />
      <Footer />
    </>
  );
}

export default App;
